  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130666 includes physical
  and profile data collected aboard the RAINIER during project OPR-P357-RA-09 in the
  Gulf of Alaska and North Pacific Ocean from 2009-08-11 to 2009-09-08. These data
  include SOUND VELOCITY and WATER TEMPERATURE. The instruments used to collect these
  data include sound velocimeter - moving vessel profiler. These data were collected
